import React, {useState, useEffect} from 'react';
import {base} from './common/APIUtils';
import './App.css';

const App = (props) => {
  const [error, setError] = useState(null);
  const [isLoaded, setIsLoaded] = useState(false);
  const [data, setData] = useState([]);

  const cryptoCurrency = {
    'Bitcoin': 'btc',
    'Ethereum': 'eth'
  }

  useEffect(() => {
    fetch(`${base}/compare/eth`, {
      method: 'GET'
    })
    .then(response => response.json())
    .then(data => {
      setData(data);
      setIsLoaded(true);
      console.log(data);
    })
    .catch((error) => {
      setIsLoaded(true);
      setError(error);
    });
  }, []);

  if (error) {
    return <div>{error.message}</div>;
  } else if (!isLoaded) {
    return <div></div>;
  } else {
    return (
      <div className="App">
        <header className="App-header">
          <p>
            {data['buy']}
          </p>
          <p>
            {data['sell']}
          </p>
        </header>
      </div>
    );
  }
}

export default App;
